import React ,{useState} from 'react'
import TodoForm from './TodoForm'

function TodoList() {
    const[todos,setTodos]=useState([])

    const AddTodo = todo =>{
        if(!todo.text||/^\s*$/.test(todo.text)){
            return
        }

        const newTodos={todo,...todos}

        setTodos(newTodos);
        console.log(...todos);
    }

    return (
        <div>
            <h1>today's plan</h1>
            <TodoForm></TodoForm>
            
        </div>
    )
}

export default TodoList
